sap.ui.define(["sap/ui/core/mvc/Controller"],function(e){"use strict";return e.extend("xlsx.controller.View1",{onInit:function(){},onDownload:function(){let e=[];let t=this.getView().byId("excel").getSelectedItems();t.forEach(t=>{let n=t.getBindingContext().getObject();e.push(n)});const n=XLSX.utils.json_to_sheet(e);const o=XLSX.utils.book_new();XLSX.utils.book_append_sheet(o,n,"Excel Sheet");XLSX.writeFile(o,"Excel Data.xlsx",{compression:true})}})});